import React from 'react'

function Posts(props){
    const {posts} = props
    console.log(props.post)
    console.log(posts)
    if (!posts || posts.post.length === 0) return <p>No Posts Found</p>
    return(
        <div>
            {props.post.map(post => {
                <h1>{post.title}</h1>
            })}
        </div>
    )
}

export default Posts
